	public static int Recursion(String s){
		Map<String,Integer> m = new HashMap<String,Integer>();
	    int maxLen = 0;
	    int lastRepeatPos = -1;
	    for(int i=0; i<s.length(); i++){
	        if (m.get(s.charAt(i)+"")!=null && lastRepeatPos < m.get(s.charAt(i)+"")) {
	            lastRepeatPos = m.get(s.charAt(i)+"");
	        }
	        if ( i - lastRepeatPos > maxLen ){
	            maxLen = i - lastRepeatPos;
	        }
	        m.put(s.charAt(i)+"",i);
	    }
		return maxLen;
	}
	
	public static int lengthnew (String s){
		int max = 0;
		Map<String,Integer> everyChar = new HashMap<String,Integer>();
		for(int i=0;i<s.length();i++){
			everyChar.put(s.charAt(i)+"", 0);
		}
		
		for(int i = 0;i<s.length();i++){
			if(everyChar.size()<=max){
				return max;
			}
			char tempc = s.charAt(i);
			int index = s.indexOf(tempc);
			int lastindex = s.lastIndexOf(tempc);
			if(everyChar.size()<lastindex-i){
				continue;
			}
			if(index == lastindex||index<i){
				lastindex = s.length();
			}
			String temp = s.substring(i,lastindex);
			System.out.println(tempc+":"+temp);
			if(temp.length()>max&&!containSameChar(temp)){
//				System.out.println(tempc+"::"+temp);
				if(temp.length()>max){
					max = temp.length();
				}
			}
			
			if(index<=i){
				index = 0;
			} 
			temp = s.substring(index,i+1);
			System.out.println(tempc+"::::"+temp);
			if(temp.length()>max&&!containSameChar(temp)){
//				System.out.println(tempc+":::"+temp);
				if(temp.length()>max){
					max = temp.length();
				}
			}
		}
//		System.out.println(max);
		return max;
	}
	
	public static int lengthOfLongestSubstring(String s) {
		Map<String,Integer> charMap = new HashMap<String,Integer>();
		
		Map<String,Integer> everyChar = new HashMap<String,Integer>();
		int max = 0;
		int charCount = Integer.MAX_VALUE;
		for(int i=0;i<s.length();i++){
			if(everyChar.containsKey(s.charAt(i)+"")){
				everyChar.put(s.charAt(i)+"", everyChar.get(s.charAt(i)+"")+1);
				if(s.charAt(i)+1<charCount){
					charCount = everyChar.get(s.charAt(i)+"");
				}
			}else {
				everyChar.put(s.charAt(i)+"", 0);
			}
		}
		
		for(int i=0;i<s.length();i++){
			if(max>(s.length()-i)){
				break;
			}
			for(int j = i;j<s.length();j++){
				if(max>(j-i)){
					continue;
				}
				String temp = s.substring(i,j+1);
				if(!containSameChar(temp)){
					if(temp.length()>max){
						max = temp.length();
					}
					charMap.put(temp, temp.length());
				}
				
			}
		}
		
		for(Entry<String, Integer> itr: charMap.entrySet()){
			System.out.println("key:"+itr.getKey() +"	value:"+itr.getValue());
		}
		System.out.println(max);
		
        return max;
    }
	
	public static boolean containSameChar(String s){
		boolean result = false;
		for(int i = 0;i<s.length();i++){
			if(s.indexOf(s.charAt(i))!=s.lastIndexOf(s.charAt(i))){
				return true;
			}
		}
		return result;
	}

